//
// x-displayName: "Fleet"
//
// Fleet is used to configure infrastructure components (like nodes) in one or
// more Volterra customer edge sites homogeneously. Fleet configuration has
// following information,
//   * Software image release to be deployed on the fleet
//   * List of devices to be configured on every node
//   * Connections between the virtual networks in the site
//   * Security policies applied in the site
//
// Fleet object must be created in the "system" namespace for the tenant
//
// Associating Fleet with Site
//
// Fleet has a field called "fleet_label". When a fleet object is created, system automatically creates a known_label
// "ves.io/fleet=<fleet_label>". The known_label is created in the "shared" namespace for the tenant.
// A site is made "member of fleet" when this known_label is added to the site. A site can have at most one known_label
// of type "ves.io/fleet" and hence belongs to exactly one fleet at any given time.
//
// When a site becomes member of fleet, all nodes in site also become "member of fleet". The fleet configuration
// is applied on all nodes that are member of the fleet.
//
// Fleet and Virtual Site
//
// Both Fleet and Virtual Sites select a list of sites based on the labels. But, there is a major difference between
// virtual_site and Fleet. Virtual_sites are intersecting sub sets of available sites. Fleet is non intersecting subset
// of available sites compared to other Fleets. As a result, at most one Fleet configuration if applied on a Site.
//
